import s from './FeedbackBtn.module.css';

const FeedbackBtn = ({ choice, onLeaveFeedback }) => {
  const item = choice.map(el => (
    <li key={el}>
      <button onClick={() => onLeaveFeedback(`${el}`)} className={s.btn}>
        Good
      </button>
    </li>
  ));
  return <ul>{item}</ul>;
};

export default FeedbackBtn;
